import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as i,a as r}from"./app-63e80163.js";const t="/assets/image-20230612125235711-fc139342.png",n="/assets/image-20230612125309211-03f58879.png",s={},d=r('<h2 id="关于我" tabindex="-1"><a class="header-anchor" href="#关于我" aria-hidden="true">#</a> 关于我</h2><p>野生程序员、迷茫的编程爱好者、五音不全的民谣爱好者、单片机爱好者。</p><p>毕业至今已经两年了，从进入大学开始先后接触C，Java，C++，C#，Python，Js，Go 等编程语言，做过全栈网站开发，小程序，爬虫，逆向，windows桌面应用开发，六组机器人，智能家居之自动感应灯，使用过的框架包括但不限于 spring全家桶，flask，pyqt5，vue，react，selenium 等，中间件 mysql， redis，rabbitMQ， MQTT 等</p><h3 id="大学篇" tabindex="-1"><a class="header-anchor" href="#大学篇" aria-hidden="true">#</a> 大学篇</h3><p>在大学期间，由于大部分时间都泡在自动化学院的实验室里，所以对于硬件的了解会多一些，对于硬件有着莫名的热爱，偏爱动手能力，从开始学习使用51单片机做一些基础的跑马灯，温度传感器，红外等基础传感器，到使用arduino和stm 32做一些项目壁障小车，六足机器人，毕业设计项目智能感应灯等</p><figure><img src="'+t+'" alt="image-20230612125235711" tabindex="0" loading="lazy"><figcaption>image-20230612125235711</figcaption></figure><figure><img src="'+n+'" alt="image-20230612125309211" tabindex="0" loading="lazy"><figcaption>image-20230612125309211</figcaption></figure><p>这是六足战士的帅照，虽然跑的慢点，但是顺利的走完了整个赛道。</p><p>除了硬件相关的技术，可能就是对于做编程题有着一定的执著，还记当时参加蓝桥杯，西南片区ACM，经常刷题到忘记时间，但是并没有很好的名次，蓝桥杯省二，西南片区ACM 三等奖，都没能够去北京参加过决赛，可能是大学的遗憾之一吧。典型的又菜又爱玩。</p><h3 id="初入职场" tabindex="-1"><a class="header-anchor" href="#初入职场" aria-hidden="true">#</a> 初入职场</h3><p>从实习到现在2年经验，我都是属于一个对于职场很陌生的人，从 一开始的不屑于准备八股文，准备面试，准备简历，到现在的被社会毒打。从不理解 “为什么要有这些奇奇怪怪面试规则，为什么要问这些毫无营养的八股文，在实际工作中有那么多的轮子，在紧张的工作几乎没有时间让你造轮子，都是用现成的，为什么在面试过程中要考察呢？现在都是联网开发，很多遇到的问题都可以通过谷歌来解决，为什么还要问呢 ？” 到现在我现在好像渐渐明白了，有一定的框架源码基础，可以让我们更快的上手新的框架，遇到问题也能更快的定位，有算法基础对于一些复杂的业务逻辑也更容易梳理出相关顺序。存在就有他的道理，虽然我现在对于八股文还是一窍不通，但是如果不想去记忆那些痛苦的八股文，我们可以去扣源码，去造轮子，自己做一遍不就清楚了吗。</p><p>这些话都是我自己告诉我自己的，希望能早日脱离苦海，早日融入社畜的行列，融入社会。</p><h3 id="关于职业发展方向-迷茫" tabindex="-1"><a class="header-anchor" href="#关于职业发展方向-迷茫" aria-hidden="true">#</a> 关于职业发展方向（迷茫）</h3><p>在接触了众多的技术和框架，也没有找到一个自己比较偏爱的编程语言和技术，感觉众多的编程语言都有他们各自的闪光点，在我接触的项目里，基本上都需要很多的编程语言配合完成，我更喜欢从0到1的完成一个项目，如果时间精力允许，我更喜欢造轮子，虽然不一定能赶上现在现存框架，但是造轮子所带来的成就和挑战是单纯对与业务crud无法媲美的。</p><h3 id="总结" tabindex="-1"><a class="header-anchor" href="#总结" aria-hidden="true">#</a> 总结</h3><p>拥有自己的开源项目，扣源码，逆向爬虫常用网站。</p>',16),o=[d];function c(h,p){return e(),i("div",null,o)}const g=a(s,[["render",c],["__file","about.html.vue"]]);export{g as default};
